import React from "react";
import { Link } from "react-router-dom";
import { CardContent, Grid, Card } from "@mui/material";

export const Addcategory = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={3}>
        <h2>Add Category</h2>
      </Grid>
      <Grid item xs={9}>
        <h3>Category Name</h3>
      </Grid>
    </Grid>
  );
};
